import "../../styles/components/header.css"

function Header () {
    return (
        <header>
            <div className="logo">
                <img src="../../assets/img/logo.png" alt="Logo SportSee" />
                <p className="logoTitle">SportSee</p>
            </div>
        </header>
    )
}

export default Header
